def count_cultures(cultures):
    """Given a list of cultures, count the number of each culture in the list and return the total number of cultures.
    The list of cultures is represented as a list of strings, where each string is the name of a culture.
    The function should return a dictionary where the keys are the names of the cultures and the values are the number of each culture.
    """
    # Initialize an empty dictionary to store the number of each culture
    culture_count = {}

    # Iterate over the list of cultures
    for culture in cultures:
        # If the culture is already in the dictionary, increment its count
        if culture in culture_count:
            culture_count[culture] += 1
        # Otherwise, add the culture to the dictionary with a count of 1
        else:
            culture_count[culture] = 1

    # Return the total number of cultures
    return sum(culture_count.values())
